import React from "react";
import Logo from "../../images/common/logo.svg";

const Header = () => {
  return (
    <div className="container-fluid d-flex justify-content-between align-items-center headerBox">
      <img src={Logo} alt="Logo" />
    </div>
  );
};

export default Header;
